import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const TextInput = ({ field, label }) => {
	const { name, value, onChange, onBlur } = field;
	return (
		<div className="row g-0">
			<label
				className="ps-2 text-start text-nowrap btn btn-primary rounded-end-0 col-4"
				htmlFor={name}
			>
				{label}
			</label>
			<div className="col-8">
				<input
					type="text"
					name={name}
					value={value || ''}
					onChange={onChange}
					onBlur={onBlur}
					className="form-control rounded-start-0"
					autoComplete="off"
				/>
			</div>
		</div>
	);
};

const NumberInput = ({ field, label }) => {
	const { name, value, onChange, onBlur } = field;
	return (
		<div className="row g-0">
			<label
				className="ps-2 text-start text-nowrap btn btn-primary rounded-end-0 col-4"
				htmlFor={name}
			>
				{label}
			</label>
			<div className="col-8">
				<input
					type="number"
					name={name}
					value={value || ''}
					onChange={onChange}
					onBlur={onBlur}
					className="form-control rounded-start-0"
					autoComplete="off"
				/>
			</div>
		</div>
	);
};

const DateInput = ({ field, form, label }) => {
	const { name, value } = field;
	const { setFieldValue } = form;

	return (
		<div className="row g-0">
			<label
				className="ps-2 text-start text-nowrap btn btn-primary rounded-end-0 col-4"
				htmlFor={name}
			>
				{label}
			</label>
			<div className="col-8">
				<DatePicker
					name={name}
					selected={value}
					onChange={(date) => setFieldValue(label, name, date)}
					dateFormat="dd/MM/yyyy"
					wrapperClassName="w-100"
					className="form-control rounded-start-0"
					autoComplete="off"
				/>
			</div>
		</div>
	);
};

const SelectInput = ({ field, options, label }) => {
	const { name, value, onChange, onBlur } = field;
	return (
		<div className="row g-0">
			<label
				className="ps-2 text-start text-nowrap btn btn-primary rounded-end-0 col-4"
				htmlFor={name}
			>
				{label}
			</label>
			<div className="col-8">
				<select
					name={name}
					value={value}
					onChange={onChange}
					onBlur={onBlur}
					className="form-select rounded-start-0"
				>
					<option value="">Select {name}</option>
					{options &&
						options.map((option, index) => (
							<option key={index} value={option.value}>
								{option.label}
							</option>
						))}
				</select>
			</div>
		</div>
	);
};

const CustomInput = ({ label, field, form, type, options, className }) => {
	switch (type) {
		case 'text':
			return <TextInput label={label} field={field} className={className} />;
		case 'number':
			return <NumberInput label={label} field={field} className={className} />;
		case 'date':
			return <DateInput label={label} field={field} form={form} className={className} />;
		case 'select':
			return <SelectInput label={label} field={field} options={options} className={className} />;
		default:
			return <div>Element not found</div>;
	}
};

export default CustomInput;
